import React, { useEffect, useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./formpost.css";
const Formpost = () => {
  return (
        <Form>
            <Form.Row>
                <Col xs={7}>
                <Form.Control placeholder="City" />
                </Col>
                <Col>
                <Form.Control placeholder="State" />
                </Col>
                <Col>
                <Form.Control placeholder="Zip" />
                </Col>
            </Form.Row>
        </Form>
  );
};

export default Formpost;
